package com.shenjinxiang.tcp;


import java.util.ArrayList;
import java.util.List;

public class Demo {

    public static void main(String[] args) {
//        String str = "" +
//                "" +
//                "" +
//                "";
        String str = "";
        System.out.println("length:" + str.length());
        int len = str.length() / 4;
        System.out.println("len: " + len);
        String[] strs = new String[] {
                str.substring(0, len),
                str.substring(len, 2 * len),
                str.substring(2 * len, 3 * len),
                str.substring(3 * len, 4 * len)
        };

        for(String s: strs) {
            System.out.println("=====================================");
            System.out.println(s);
            byte[] bytes = ByteKit.hexStrToByteArray(s);
            System.out.println("len: " + bytes.length);
            Wave wave = new Wave();
            int p = ByteArrayConveter.getInt(bytes, 0);
            wave.setPickpoint(p);
            int index = 4;
            List<Float> floats = new ArrayList<>();
            while (index < bytes.length) {
                float f = ByteArrayConveter.getFloat(bytes, index);
                floats.add(f);
                index+=4;
            }
            wave.setData(floats);
            System.out.println(JsonKit.toJson(wave));
        }

    }
}
